    - "Here is the SPARQL query to find the name of the most northern port in the\
      \ knowledge graph:\n\n```sparql\nSELECT ?portName ?lat WHERE {\n  ?port a ns2:Port\
      \ .\n  ?port ns2:hasLatitude ?lat .\n  ?port rdfs:label ?portName .\n}\nORDER\
      \ BY DESC(?lat)\nLIMIT 1 \n```\n\nThis queries for all ports, gets their latitude\
      \ and name, orders by decreasing latitude, and limits to 1 result to get the\
      \ most northern port."
